#include <avr/io.h>
#include <util/delay.h>

#define CODE_SIZE 6
const char BOARD[] = "P123T456M789BC0EOSLA";
char input[CODE_SIZE + 1] = "";
size_t len;

#define TX_PIN PD3
#define BAUD_DELAY_US 104 // 9600 baud

void uart_transmit(char data) {
 // Start bit (low)
 PORTD &= ~(1 << TX_PIN);
 _delay_us(BAUD_DELAY_US);

 // Transmit 8 data bits (LSB first)
 for (uint8_t i = 0; i < 8; i++) {
 if (data & (1 << i)) {
 PORTD |= (1 << TX_PIN); // Send 1
 } else {
 PORTD &= ~(1 << TX_PIN); // Send 0
 }
 _delay_us(BAUD_DELAY_US);
 }

 // Stop bit (high)
 PORTD |= (1 << TX_PIN);
 _delay_us(BAUD_DELAY_US);
}

void send(void) {
 for (size_t i = 0; i < CODE_SIZE; i++) {
 if (input[i] == '\0') break;
 uart_transmit(input[i]);
 }

 uart_transmit('\n');
}

void pressed(char c) {
 if ('0' <= c && c <= '9') {
 len = strlen(input);
 if (len < CODE_SIZE) {
 input[len] = c;
 input[len + 1] = '\0';
 }
 }

 if (c == 'C' && (len = strlen(input)) > 0) {
 input[len - 1] = '\0';
 }
}

